CREATE TABLE `pengajuan` (
  `id` int NOT NULL AUTO_INCREMENT,
  `id_template` int NOT NULL,
  `cpu` int DEFAULT NULL,
  `ram` int DEFAULT NULL,
  `storage` int DEFAULT NULL,
  `segment` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `status_pengajuan` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `nama_aplikasi` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
