  `jenis_pengajuan` enum('New','Existing','Delete','Perubahan') COLLATE utf8mb4_unicode_ci NOT NULL,
  `vmid` int DEFAULT NULL,
  `nodes` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `nama_baru` varchar(191) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `vmid_old` int DEFAULT NULL,
  `user` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  `divisi` varchar(191) COLLATE utf8mb4_unicode_ci NOT NULL,
  PRIMARY KEY (`id`),
